import React, { Component } from 'react';
import './App.css';
import axios from 'axios';
import AlgorithmSetup from './AlgorithmSetup';


class GetAnAlgorithm extends Component {
  constructor(props) {
    super(props);
    this.state = {
      getID:1,
      algorithm: [{ algID: "1time", name:"",moves: "1alg" ,scramble:"",userID:"" }]

    }
  }

  getRequest = () => {
    axios.get(`/getAnAlgorithm/${this.state.getID}`).then(r => { this.setState({ algorithm: r.data }) });
  }  
 

//   setStates = (event)=>{ 
