  render() {
    // let times = this.state.times.map(t => <TimeListItems timeID={t.timeID} time={t.time} algID={t.algID} />) 
    let algorithm = this.state.algorithm.map(a=><AlgorithmSetup algID={a.algID} name={a.name} moves={a.moves} scramble={a.scramble} userID={a.userID}/>)
    return (
      <div>
            {/* <form onSubmit={this.handleSubmit} className="form-inline">  
                <label> 
                    <input type="number" name='getID' target='one' className="form-control inputArea" onChange={this.setStates} getID={this.state.getID} id="getID" placeholder="getID *"></input>
                </label> 
                <input type="submit" value="Submit" onClick={this.getRequest}></input>

            </form>  */}
            <ul>{algorithm}</ul> 
            <button onClick={this.getRequest}>Click</button>
      </div>

    );

  }

}

export default GetAnAlgorithm;
